webpackJsonp([0xaa3e0c954dbe],{284:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Annalisa Valente"}},contentfulPageSelectorPanel:{pages:[{name:"Brave the Shave",title:null,slug:"/projects/macmillan",description:"Redesigning Brave the Shave microsite"},{name:"Google",title:"Google",slug:"/projects/google/",description:"Interaction designer contractor in the Google Play Console team at Google UK."},{name:"The Telegraph",title:null,slug:"/projects/thetelegraph/",description:"Working with PO and Developers to bring continuous improvements to the newspaper digital experience."},{name:"MyMail & Nectar",title:null,slug:"/projects/mymail-and-nectar/",description:"Launch of MyMail and Nectar proposition to collect Nectar points with the DailyMail."},{name:"Nectar ",title:null,slug:"/projects/nectar/",description:"Delivering a new personalised user experience on Nectar web and iOS-Android app."},{name:"Face and Name ",title:null,slug:"/projects/face-name/",description:"Concept of an android experience that helps educators match faces to names."},{name:"The Telegraph puzzle ",title:null,slug:"/projects/the-telegraph-puzzle/",description:"Redesign the experience of the Telegraph puzzle website."},{name:"Mindfulness Moments",title:"Mindfulness Moments",slug:"/projects/mindfulness-moments",description:"Microsite for Macmillan Cancer Support"},{name:"New page",title:null,slug:"new-page",description:"A new description"}]},contentfulPage:{slug:"/projects/thetelegraph/",password:null,panels:[{__typename:"ContentfulContentPanel",content:{content:"My role: UX Designer\n\nProjects: Edition app - Live app - The Telegraph puzzle website - My Telegraph \n\n\n\n__PROCESS AND WAY OF WORKING__\n\nAt The Telegraph I worked in the product team as a UX designer and my responsability was to deliver an engaging reading experience to the readers.\n\nWith a fast prototyping and early testing approach we improved the products building essential features that increased the engagement and the consumption of articles improving the online and offline experiences.\n\n__DESIGN SPRINTS AND WORKSHOPS__\n\nI was involved in various design sprints to help to shape the future of the products in order to create a superior experience for the users. Working closely to the PO, stakeholders, user researchers and business folks, my duty was to help the team in order to shape the product’s roadmap and prioritise features. \n\n\nMy Telegraph: a new way to get the news\n\nThe concept went [live](https://www.telegraph.co.uk/news/2018/07/06/introducing-telegraph-new-way-get-news/) in July 2018.\n\nWhat we did and what we implemented:\n\n- I helped to develop the new personas for the new propositions working closely with the researcher teams and analytics team.\n- \n![Artboard](//images.ctfassets.net/wk0hltq7eofw/5BuRI6hIcg4qGgC808oocY/4b7906a91dd499a984cead21d4d82630/Artboard.jpg)\n\n- Following a design sprint we developed My Telegraph section: this is the personal space of the user. It contains: all saved articles, content tailored for the user based on their behaviour and precedent activities. \n\n![IMG 0468](//images.ctfassets.net/wk0hltq7eofw/3eP2EWQHJYooEUAO2Qc6kO/51fc9e81b092bf2a6969bf7d9841d27b/IMG_0468.JPG)\n\nAt the end of the design sprint we tested the concept with real users.\n\n![Screen+Shot+2018-08-22+at+00.10.25](//images.ctfassets.net/wk0hltq7eofw/4Z9fOJkXkswqK8wqmQAQQO/ce3fc02f7ecd3825d0a2722fbeef3dfd/Screen_Shot_2018-08-22_at_00.10.25.png)- Save article feature\n\n- Updated navigation and section pages\n\n\n\n\n  Link to the prototype  \n  \n  \n\n\n\n",childMarkdownRemark:{html:'<p>My role: UX Designer</p>\n<p>Projects: Edition app - Live app - The Telegraph puzzle website - My Telegraph </p>\n<p><strong>PROCESS AND WAY OF WORKING</strong></p>\n<p>At The Telegraph I worked in the product team as a UX designer and my responsability was to deliver an engaging reading experience to the readers.</p>\n<p>With a fast prototyping and early testing approach we improved the products building essential features that increased the engagement and the consumption of articles improving the online and offline experiences.</p>\n<p><strong>DESIGN SPRINTS AND WORKSHOPS</strong></p>\n<p>I was involved in various design sprints to help to shape the future of the products in order to create a superior experience for the users. Working closely to the PO, stakeholders, user researchers and business folks, my duty was to help the team in order to shape the product’s roadmap and prioritise features. </p>\n<p>My Telegraph: a new way to get the news</p>\n<p>The concept went <a href="https://www.telegraph.co.uk/news/2018/07/06/introducing-telegraph-new-way-get-news/">live</a> in July 2018.</p>\n<p>What we did and what we implemented:</p>\n<ul>\n<li>I helped to develop the new personas for the new propositions working closely with the researcher teams and analytics team.</li>\n<li></li>\n</ul>\n<p><img src="//images.ctfassets.net/wk0hltq7eofw/5BuRI6hIcg4qGgC808oocY/4b7906a91dd499a984cead21d4d82630/Artboard.jpg" alt="Artboard"></p>\n<ul>\n<li>Following a design sprint we developed My Telegraph section: this is the personal space of the user. It contains: all saved articles, content tailored for the user based on their behaviour and precedent activities. </li>\n</ul>\n<p><img src="//images.ctfassets.net/wk0hltq7eofw/3eP2EWQHJYooEUAO2Qc6kO/51fc9e81b092bf2a6969bf7d9841d27b/IMG_0468.JPG" alt="IMG 0468"></p>\n<p>At the end of the design sprint we tested the concept with real users.</p>\n<p><img src="//images.ctfassets.net/wk0hltq7eofw/4Z9fOJkXkswqK8wqmQAQQO/ce3fc02f7ecd3825d0a2722fbeef3dfd/Screen_Shot_2018-08-22_at_00.10.25.png" alt="Screen+Shot+2018-08-22+at+00.10.25">- Save article feature</p>\n<ul>\n<li>Updated navigation and section pages</li>\n</ul>\n<p>  Link to the prototype  </p>'}}}]}},pathContext:{slug:"/projects/thetelegraph/"}}}});
